import React, { StrictMode } from 'react';
import { BrowserRouter as Router, Route, Link, Routes, BrowserRouter } from 'react-router-dom';
import Main from "./pages/Main";
import './App.css';

function App() {
  return (
    <div>
      <Router>
        <div>
          <nav>
            <Link to="/">メイン</Link>
          </nav>
          <Routes>
            <Route path='/' element={<Main />}></Route>
          </Routes>
        </div>
      </Router>
      <Main />
    </div>
  );
}

export default App;
